import styled from "styled-components";

export const StyledPokeDetailCard = styled.div`
  text-align: center;
  font-family: "Quicksand";
  border: 1px solid goldenrod;
  width: 70%;
  margin: 10px auto;
  padding-top: 5px;
  height: 72px;
  color: #877455;

  .info {
    display: flex;
  }
`;
